result.description:
Report on prevalence/colonization rates per isolate, biological antagonism, parasitism, host preference and other data allowing the evaluation and selection of EBCAs. Numerical results of parasitism assays carried out to evaluate BW antagonisms by microorganisms or EPN. Includes :
1) data on risk analysis for the EBCAs selected and suitable for applications in other WPs, prior to their introduction in the field, data from assays with non target invertebrates, and of dual cultures with other soil microorganisms;
2) knowledge produced on the microorganisms, shown in databases available on line (i.e. NCBI), including sequence and other data such as host colonization, target pests prevalence, and endophytism.
